import Navbar from './components/elements/header/navbar';
import React from 'react';
import CardList from './components/CardList';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Navbar/>

      </header>
      <main className="body">

      <CardList fallback={"Loading..."}></CardList>
      </main>
    </div>

  );
}

export default App;
